import React, { useState, useEffect } from "react";
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';

const initialValues = {
  id: 0,
  title: "",
  price: "",
  vehicles: "",
  city: "",
  river: "",
  postalCode: "",
  street: "",
  streetNumber: "",
  description: "",
  imageURL: "",
};

export default function AddNewOfferForm() {
  const [values, setValues] = useState(initialValues);

  return (
    <form>
      <Grid container>
        <Grid item xs={6}>
            <TextField
            variant="outlined"
            label="Title"
            value={values.title}
            />
             <TextField
            variant="outlined"
            label="Price"
            value={values.price}
            />
             <TextField
            variant="outlined"
            label="city"
            value={values.city}
            />
             <TextField
            variant="outlined"
            label="River"
            value={values.rier}
            />
             <TextField
            variant="outlined"
            label="Postal Code"
            value={values.postalCode}
            />
             <TextField
            variant="outlined"
            label="Street"
            value={values.streetNumber}
            />
             <TextField
            variant="outlined"
            label="Description"
            value={values.description}
            />

        </Grid>
        <Grid item xs={6}></Grid>
      </Grid>
    </form>
  );
}
